import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    var firstName = 'Leigh';
    var lastName = 'Olesen';
    var username = {firstName}.toString() + ' ' + toString({lastName});
    var helloWorld = 'Welcome to the Road to learn React';
    return (
      <div className="App">
        <h2>{helloWorld}, {username}</h2>
      </div>
    );
  }
}

export default App;
